import React from "react";
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardHeader,
  CardMedia,
} from "@mui/material";

export default function TourContent({ id, image, info, name, price }) {
  return (
    <Card>
      <CardMedia
        component="img"
        height="194"
        image={image}
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {name}
        </Typography>
        <Typography variant="body2" color="text.secondary">
            {price}
        </Typography>
      </CardContent>
    </Card>
  );
}
